const _Auth = "";

const setAuth = (auth) => {
  _Auth = auth;
};

const getAuth = () => {
  return _Auth;
};

class Auths {
  auth = "";
  getAuths() {
    return this.auth;
  }
  setAuths(val) {
    this.auth = val;
  }
}
export default Auths;
